import React from 'react';

const SeasonsDisplay = () => {
	const seasonConfig = {
		summer: {
			text: 'Lets hit the beach',
			icon: 'sun',
		},
		winter: {
			text: 'Burr its chilly!!',
			icon: 'clouds',
		},
	};
	return;
};

export default SeasonsDisplay;
